package com.easytop.psm.model;


public class SellEntry {

	private String s_sellName;
	private String s_brand;
	private String s_model;
	private String s_date;
	private int s_number;
	public SellEntry() {
		super();
		// TODO Auto-generated constructor stub
	}
	public SellEntry(String s_sellName, String s_brand, String s_model, String s_date, int s_number) {
		super();
		this.s_sellName = s_sellName;
		this.s_brand = s_brand;
		this.s_model = s_model;
		this.s_date = s_date;
		this.s_number = s_number;
	}
	public String getS_sellName() {
		return s_sellName;
	}
	public void setS_sellName(String s_sellName) {
		this.s_sellName = s_sellName;
	}
	public String getS_brand() {
		return s_brand;
	}
	public void setS_brand(String s_brand) {
		this.s_brand = s_brand;
	}
	public String getS_model() {
		return s_model;
	}
	public void setS_model(String s_model) {
		this.s_model = s_model;
	}
	public String getS_date() {
		return s_date;
	}
	public void setS_date(String s_date) {
		this.s_date = s_date;
	}
	public int getS_number() {
		return s_number;
	}
	public void setS_number(int s_number) {
		this.s_number = s_number;
	}
	@Override
	public String toString() {
		return "SellEntry [s_sellName=" + s_sellName + ", s_brand=" + s_brand + ", s_model=" + s_model + ", s_date="
				+ s_date + ", s_number=" + s_number + "]";
	}
	
	
}
